import './Style.css';

function Juego() {
    function comparaNumero(){
        const numeroRandom = Math.floor(Math.random() * 100);
        const intento = document.getElementById("numeroUsuario")
    }
    return (
        <div class="container">
            <div className='juegoContainer'>
                <button class="arrow-up">&#9650;</button>
                <div class="intento">
                    <input type="text" id="numeroUsuario"></input>
                </div>
                <button class="arrow-down">&#9660;</button>
                <button 
                    onClick={comparaNumero}
                ></button>
            </div>
        </div>

    );
}

export default Juego;
